/**
    * ðŸ‘‰ : moves the memory pointer to the next cell

    * ðŸ‘ˆ : moves the memory pointer to the previous cell

    * ðŸ‘† : increment the memory cell at the current position

    * ðŸ‘‡ : decreases the memory cell at the current position.

    * ðŸ¤œ : if the memory cell at the current position is 0, jump just after the corresponding ðŸ¤›

    * ðŸ¤› : if the memory cell at the current position is not 0, jump just after the corresponding ðŸ¤œ

    * ðŸ‘Š : Display the current character represented by the ASCII code defined by the current position.        
 */



function translate(input) {

    const byteArray = [];
    let pointer = 0;
    let index = 0;
    let operationCounter = 0;


    let output = '';

    const arrayOfInstruccions = Array.from(input); // algo como [ "ðŸ‘‰", "ðŸ‘ˆ", "ðŸ‘†", "ðŸ‘‡", "ðŸ¤œ", "ðŸ¤›", "ðŸ‘Š" ];

    const actions = {
        'ðŸ‘†': () => {
            byteArray[pointer] ??= 0;

            if (byteArray[pointer] === 255) {
                byteArray[pointer] = 0;
            }
            else {
                byteArray[pointer]++;     
            }
        },
        'ðŸ‘‡': () => {
            byteArray[pointer] ??= 0;

            if (byteArray[pointer] === 0) {
                byteArray[pointer] = 255;
            } else {
                byteArray[pointer]--;   
            }
        },
        'ðŸ‘‰': () => {
            pointer++;
            byteArray[pointer] ??= 0;
        },
        'ðŸ‘ˆ': () => {
            pointer--;
            byteArray[pointer] ??= 0;
        },
        'ðŸ¤œ': () => {
            if (byteArray[pointer] === 0) {

                let fistCounter = 1;
                while ((index < arrayOfInstruccions.length - 1)) {
                    index++;
                    if (arrayOfInstruccions[index] === "ðŸ¤œ") {
                        fistCounter++;
                    } else if (arrayOfInstruccions[index] === "ðŸ¤›") {
                        fistCounter--;
                    }
                    if (fistCounter === 0) {
                        break;
                    }
                }
            }            
        },
        'ðŸ¤›': () => {
            if (byteArray[pointer] !== 0) {

                let fistCounter = 1;
                while ((index > 0)) {
                    index--;
                    if (arrayOfInstruccions[index] === "ðŸ¤œ") {
                        fistCounter--;
                    } else if (arrayOfInstruccions[index] === "ðŸ¤›") {
                        fistCounter++;
                    }
                    if (fistCounter === 0) {
                        break;
                    }
                }
            }
        },
        'ðŸ‘Š': () => {
            // console.log(String.fromCharCode(byteArray[pointer]))
            output += String.fromCharCode(byteArray[pointer]);
        }

    }
        
    const array_de_acciones = [];

    while (index < arrayOfInstruccions.length) {
        const action = arrayOfInstruccions[index];
        actions[action]();
        array_de_acciones.push(action)
        // console.log({ action,
        //     "index": index, 
        //     "pointer": pointer,
        //     "currentValue": byteArray[pointer],
        //     "output": output
        // })
        index++;
    }


    return output;
    
}

